{"payload":{"allShortcutsEnabled":true,"fileTree":{"":{"items":[{"name":"MetabolomicsAnalysis_maplet.R","path":"MetabolomicsAnalysis_maplet.R","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"}],"totalCount":2}},"fileTreeProcessingTime":1.576952,"foldersToFetch":[],"reducedMotionEnabled":"system","repo":{"id":395825452,"defaultBranch":"main","name":"glioma-cysteine","ownerLogin":"krumsieklab","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2021-08-13T18:19:27.000-05:00","ownerAvatar":"https://avatars.githubusercontent.com/u/69219936?v=4","public":true,"private":false,"isOrgOwned":true},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"main","listCacheKey":"v0:1628896768.4002151","canEdit":true,"refType":"branch","currentOid":"422dd8798c0de65dbbc2beddcf6d6493bcb49cbc"},"path":"MetabolomicsAnalysis_maplet.R","currentUser":{"id":67301563,"login":"Ekn2484","userEmail":"evan.noch@de-stroke.com"},"blob":{"rawLines":["#### Initialize ----","","rm(list = ls())","# set working directory","setwd(dirname(rstudioapi::getActiveDocumentContext()$path))","","# load libraries","library(maplet)","library(dplyr)","","#### Global Parameters ----","","# pathway of interest","pw <- \"Cysteine, methionine, SAM, taurine metabolism\" ","# maximum missingness allowed for normalization","max_miss_norm <- 0.2","# maximum missingness allowed per grade","max_miss <- 0.85","# significance level","alpha <- 0.05","","##### Define Functions ----","","# Downloads files from the web and verifies their checksum. ","# Will use local copy in current directory, if it exists","load.web.file <- function(","  url, md5sum, outfile, zipfile = F) {","  # check if local file exists","  if (file.exists(outfile)) {","    # verify checksum","    realsum <- tools::md5sum(outfile)[[1]]","    if (realsum != md5sum) stop(sprintf(\"Local file %s has wrong checksum: %s\", outfile, realsum))","    # do not delete wrong file, it was already here before","    ","  } else {","    if(zipfile){","      # download file","      temp <- tempfile()","      download.file(url,temp)","      unzip(zipfile = temp, files = outfile, exdir = \".\")","    } else {","      # download file","      download.file(url, outfile)","    }","    # verify checksum","    realsum <- tools::md5sum(outfile)[[1]]","    if (realsum != md5sum) { ","      # delete wrong file","      unlink(outfile)","      stop(sprintf(\"Remote file %s has wrong checksum: %s\", url, realsum))","    }","  }","}","","diff_analysis_tau <- function(D, outvar, name, alpha) {","  D %>%","    # Kendall's correlation for ordinal variables","    mt_stats_univ_cor(in_col = outvar,","                      method = \"kendall\",","                      stat_name = name,","                      samp_filter =(!is.na(!!sym(outvar)))) %>%","    # add multiple testing correction","    mt_post_multtest(stat_name = name, method = \"BH\") %>%","    # volcano plot as overview of results","    mt_plots_volcano(stat_name     = name,","                     x = statistic,","                     feat_filter =  p.adj < alpha,","                     colour       = p.adj < alpha) %>%","    # boxplots of significant results","    mt_plots_box_scatter(plot_type = \"box\",","                         stat_name = name,","                         x    = !!sym(outvar),","                         fill  = !!sym(outvar),","                         feat_filter = p.adj < 0.05,","                         feat_sort = p.value,","                         restrict_to_used_samples = T,","                         jitter = \"jitter\",","                         annotation   = \"{sprintf('P-value: %.1e', p.value)}\\nP.adj: {sprintf('%.1e', p.adj)}\")","}","","#### Load Data ----","","# file name","file <- \"Chinnaiyan_et_al_Metabolon_original.xlsx\"","# download metabolomics data from Figshare","load.web.file(","  url=\"https://figshare.com/ndownloader/files/30552759\",","  md5sum = \"42df0ca798ac4cdefe23c8a3f58e71cf\",","  outfile = file",")","","D <- mt_reporting_heading(heading = \"Load Data\", lvl = 1) %>%","  # load data sheet","  mt_load_xls(file=file, sheet=\"data\", samples_in_rows=T, id_col=\"SAMPLE_NAME\") %>% ","  # load sample annotation sheet","  mt_anno_xls(file=file, sheet=\"sampleinfo\", anno_type=\"samples\", anno_id_col=\"SAMPLE_NAME\") %>% ","  # load metabolite annotation sheet","  mt_anno_xls(file=file, sheet=\"metinfo\", anno_type=\"features\", anno_id_col=\"BIOCHEMICAL\", data_id_col=\"name\") %>%","  # convert grade to numeric for analysis","  mt_anno_mutate(anno_type = \"samples\", col_name = \"GRADE.tau\", term = case_when(GRADE==\"II\"~2,","                                                                                 GRADE==\"III\"~3,","                                                                                 GRADE==\"IV\"~4)) %>%","  # convert run day variable to factor for batch correction","  mt_anno_mutate(anno_type = \"samples\",col_name = \"RUN.DAY\", term = as.factor(RUN.DAY))","","#### Preprocessing ----","","D <- D %>%","  mt_reporting_heading(heading=\"Preprocessing\", lvl=1) %>%","  # sample boxplots before batch correction","  mt_plots_sample_boxplot(color=RUN.DAY, title='before batch correction - RUN DAY',plot_logged=T) %>%","  mt_plots_sample_boxplot(color=Group, title='before batch correction - Group',plot_logged=T) %>% ","  # batch correction","  mt_pre_batch_median(batch_col = \"RUN.DAY\") %>%","  # sample boxplots after batch correction","  mt_plots_sample_boxplot(color=RUN.DAY, title='after batch correction - RUN DAY',plot_logged=T) %>%","  mt_plots_sample_boxplot(color=Group, title='after batch correction - Group',plot_logged=T) %>%","  # normalization","  mt_pre_norm_quot(feat_max = max_miss_norm) %>% ","  mt_plots_dilution_factor(in_col = \"Group\") %>%","  # sample boxplots after normalization","  mt_plots_sample_boxplot(color=RUN.DAY, title='after normalization - RUN DAY',plot_logged=T) %>%","  mt_plots_sample_boxplot(color=Group, title='after normalization - Group', plot_logged=T) %>%","  # log transformation","  mt_pre_trans_log()","","#### Filtering ----","","D <- D %>%","  mt_reporting_heading(heading = \"Select Cysteine Pathway\", lvl=1) %>%","  # keep only metabolites in cysteine pathway","  mt_modify_filter_features(filter = SUB.PATHWAY %in% pw) %>%","  mt_reporting_heading(heading = \"Filtering\", lvl=1) %>%","  # filter out metabolites with too many missing values (if any)","  mt_plots_missingness(feat_max=max_miss) %>%","  mt_pre_filter_missingness(feat_max=max_miss, group_col = \"Group\") %>%","  mt_plots_missingness(feat_max=max_miss)","","#### Perform Differential Analysis ----","","D <- D %>%","  mt_reporting_heading(heading = \"Differential Analysis - metabolites\", lvl=1) %>%","  # perform differential analysis","  diff_analysis_tau(outvar=\"GRADE.tau\", name=\"Grade II vs. III vs. IV\", alpha=alpha)","","#### Write to File ----","","D %<>%","  # write report to html","  mt_reporting_html(file=\"Glioma_GradeDifferentialAnalysis_CysteinePathway.html\", ","                    title=\"Analysis Pipeline\")","","D %<>%  ","  # write statistical results to file","  mt_write_stats(file = \"DifferentialAnalysisResults.xlsx\")"],"stylingDirectives":[[{"start":0,"end":20,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[],[{"start":3,"end":7,"cssClass":"pl-v"},{"start":8,"end":9,"cssClass":"pl-k"}],[{"start":0,"end":23,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":14,"end":24,"cssClass":"pl-e"},{"start":24,"end":26,"cssClass":"pl-k"},{"start":52,"end":53,"cssClass":"pl-k"},{"start":53,"end":57,"cssClass":"pl-smi"}],[],[{"start":0,"end":16,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":8,"end":14,"cssClass":"pl-smi"}],[{"start":8,"end":13,"cssClass":"pl-smi"}],[],[{"start":0,"end":27,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[],[{"start":0,"end":21,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[